var tablePath = $["CMA with factors and description"];
var oldTable = tablePath.getDataElement();
var newTablePath = tablePath.getSiblingPath("CMA model on genes annotated");
var newTable = oldTable.clone(tablePath.getParentCollection(), newTablePath.getName());
newTablePath.save(newTable);
var model = newTable.getColumnModel();
var cnt = model.getColumnCount();
var renaming = {"Names":"Gene symbol","Score":"CMA score","Title":"Factor names"};
var i=0;
for(i=0; i<cnt; i++)
{
  var name = model.getColumn(i).getName();
  for(var substr in renaming)
  {
    if(name == substr)
    {
      model.renameColumn(i, renaming[substr]);
      break;
    }
  }
}

//Copy table from oldTablePath to newTablePath and then clean original table (by removing and creating empty one)
var tableCopyAndClean = function(oldTablePath, newTablePath)
{
  var parent = oldTablePath.getParentCollection();
  var newTable  = oldTablePath.getDataElement().clone(parent, newTablePath.getName());
  newTablePath.save(newTable);
  oldTablePath.remove();
  var oldTableEmpty = Packages.ru.biosoft.table.TableDataCollectionUtils.createTableLike(newTable, oldTablePath);
  oldTablePath.save(oldTableEmpty);
};

