var deURL = function(dePath, deName, addition)
{
  return "<a href='/bioumlweb/#de=" + dePath + "' target='_parent'>" + deName + "</a> " + addition + "| <a href='#toc'>TOC</a>";
};
var colnamesToIdxs = function(table, colnames)
{
  var idxs = [];
  for(var i=0; i<colnames.length; i++)
  {
    idxs.push(table.getColumnModel().getColumnIndex(colnames[i]));
  }
  return idxs;
};
var tableTargets = function(report,table)
{
  var wantedColnames = [
    "Name",
    "Druggability score"
  ];
  showTable(report,table,wantedColnames,"Druggability score");
};
var tableStructures = function(report,table)
{
  var wantedColnames = [
    "Name",
    "Structure",
    "Target names",
    "Target activity score",
    "Toxicity score",
    "Disease activity score",
  ];
  showTable(report,table,wantedColnames,"Target activity score");
};
var showTable = function(report,table,colnames,sortBy)
{
  var cols = colnamesToIdxs(table, colnames);
  var model = table.getColumnModel();
  var sortIdx = model.getColumnIndex(sortBy);
  table.sortTable(sortIdx, false);
  var headers = [];
  headers.push("ID");
  for(var i = 0; i<cols.length; i++)
  {
    headers.push(model.getColumn(cols[i]).getName());
  }
  var data = [];
  var count = table.getSize();
  if( count > 10 ) count = 10;
  for(var i=0; i<count; i++)
  {
    var rde = table.getAt(i);
    var row = rde.getValues();
    var dataRow=[];
    dataRow.push(rde.getName());
    for(var j = 0; j<cols.length; j++)
    {
      dataRow.push(row[cols[j]]);
    }
    data.push(dataRow);
  }
  report.addTable(headers, data, "data", false);
};

