var generateSequence = function(start, length, step)
{
  seq = [];
  for (var i = 0; i < length; i++) {
    seq.push(start+i*step);
  }
  return seq;
};

var idxSeq = function(length)
{
  return generateSequence(0, length, 1);
};

var colnamesToIdxs = function(table, colnames)
{
  var idxs = [];
  for(var i=0; i<colnames.length; i++)
  {
    idxs.push(table.getColumnModel().getColumnIndex(colnames[i]));
  }
  return idxs;
};

var showTable = function(report,table,colnames,sortBy,isAscending)
{
  var model = table.getColumnModel();
  var width = model.getColumnCount();
  if(!colnames)
  {
    cols = idxSeq(width);
  }
  else
  {
    cols = colnamesToIdxs(table, colnames);
  }
  var model = table.getColumnModel();
  var sortIdx = model.getColumnIndex(sortBy);
  table.sortTable(sortIdx, isAscending);
  var headers = [];
  headers.push("ID");
  for(var i = 0; i<cols.length; i++)
  {
    headers.push(model.getColumn(cols[i]).getName());
  }
  var data = [];
  var count = Math.min(10, table.getSize());
  for(var i=0; i<count; i++)
  {
    var rde = table.getAt(i);
    var row = rde.getValues();
    var dataRow=[];
    dataRow.push(rde.getName());
    for(var j = 0; j<cols.length; j++)
    {
      dataRow.push(row[cols[j]]);
    }
    data.push(dataRow);
  }
  report.addTable(headers, data, "data", false);
};

var tableTFgenes = function(report,table)
{
  var wantedColnames = [
    "Gene symbol",
    "Gene description",
    "Species"
  ];
  showTable(report,table,wantedColnames,"Gene symbol", true);
};

